                        {/* color */}
                        <div style={{backgroundColor: colors[2]}} className="h-full rounded"></div>
                    </div>
                    {/* 4 */}
                    <div className="w-1/6 flex flex-col justify-between">
                        {/* color */}
                        <div style={{backgroundColor: colors[3]}} className="h-full rounded"></div>
                    </div>
                    {/* 5 */}
                    <div className="w-1/6 flex flex-col justify-between">
                        {/* color */}
                        <div style={{backgroundColor: colors[4]}} className="h-full rounded"></div>
                    </div>
                </div>
            </div>
        </div>
    )
}


export default ColorDetection;
